create table ad (
	ad_id INT PRIMARY KEY,
	show_salary BIT NOT NULL,
	minimum_license VARCHAR(50),
	minimum_experience INT,
	title VARCHAR(50) NOT NULL,
	time_added DATE NOT NULL,
	type VARCHAR(50),
	location VARCHAR(50),
	minimum_wage VARCHAR(50),
	maximum_wage VARCHAR(50),
	resume_date_expire DATE,
	description TEXT,
	contact_email VARCHAR(50) NOT NULL,
	intro_video_url VARCHAR(1000),
	company_id INT NOT NULL,
	FOREIGN KEY (company_id) REFERENCES company (company_id) ON DELETE CASCADE ON UPDATE CASCADE
);

